DROP TABLE IF EXISTS `jyx_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `jyx_user` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '表主键',
  `name` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '姓名',
  `IDType` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '证件类型',
  `UID` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '身份证号',
  `sex` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '性别',
  `dateBirth` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '出生日期',
  `eduLevel` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '文化程度',
  `source` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '考生来源',
  `receive` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '证件领取',
  `professionalName` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '职业名称',
  `workType` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '工种名称',
  `level` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '级别',
  `conditions` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '申报条件',
  `phone` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '手机号',
  `workDate` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '参加工作时间',
  `work` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '从事专业',
  `workYear` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '专业年限',
  `nation` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '民族',
  `politicalStatus` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '政治面貌',
  `serialNumber` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '学历证书编号',
  `experience` text COLLATE utf8mb4_general_ci COMMENT '简要经历',
  `postalCode` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '邮政编码',
  `currentUnit` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '所在单位',
  `address` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '通讯地址',
  `postAddress` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '邮寄地址',
  `email` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '邮箱',
  `place` varchar(256) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '户籍所在地',
  `province` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '省份',
  `city` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '城市',
  `OCO` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '原证书职业',
  `OCL` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '原证书等级',
  `OCN` varchar(64) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '原证书编号',
  `userPic` varchar(600) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '用户照片',
  `userCertify` varchar(600) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '学籍在线证明或工作证明',
  `userPay` varchar(600) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '支付凭证',
  `isPay` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '已支付|未支付',
  `payAmount` varchar(30) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '支付金额',
  `created_at` datetime(3) DEFAULT NULL,
  `deleted_at` datetime(3) DEFAULT NULL,
  `updated_at` datetime(3) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_jyx_user_deleted_at` (`deleted_at`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
